	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 730px; min-height: 108px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 720px; min-height: 98px;\"><p style=\"text-align: left; line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size:12pt;\">Den mest miljøvennlige maten er den naturen lager helt av seg selv. Bær, sopp, ville urter, skjell og vilt er blant delikatessene som naturen har å by på. Mye av ugresset er også spiselig: Unge skudd av løvetann, skvallerkål og brennenesle kan brukes som grønnsaker. Dyrk eventuelt egne grønnsaker, bær og frukt.</span></p></div></div>",
